      "title": "Consent Form",
      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n  \u003Cdiv style=\"width: 90%;\"\u003E\n    \n    \u003Ch2\u003ETERMO DE CONSENTIMENTO\u003C\u002Fh2\u003E\n\n    \u003Ch3\u003EEntendendo o Processamento de Palavras e do seu Significado\u003C\u002Fh3\u003E\n\n    \u003Cp class=\"text-left\"\u003EConvidamos você a participar de uma pesquisa sobre como as pessoas leem e processam palavras, assim como seu significado. Pedimos que você leia este termo e faça todas as perguntas que possa ter antes de concordar em participar do estudo.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EEste estudo está sendo dirigido pela Dra. Erin M. Buchanan, Professora de Análise Cognitiva da Universidade de Ciência e Tecnologia de Harrisburg.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EInformações básicas:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Neste estudo, você será convidado a responder a diferentes perguntas sobre conceitos de palavras. Por exemplo, podemos solicitar que você defina as características de uma palavra, que você avalie o quanto tem familiaridade com uma determinada palavra ou que você simplesmente julgue se uma sequência de letras é uma palavra real ou uma falsa palavra. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EProcedimentos:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n  Você participará deste a partir de um computador de mesa ou laptop\u002Fnotebook com teclado. Você receberá instruções sobre as seções do experimento que são selecionadas aleatoriamente para cada pessoa. Depois de concluir o experimento, você pode aprender mais sobre o estudo e os objetivos da pesquisa. O estudo inteiro deve levar menos de trinta minutos para ser concluído.\u003C\u002Fp\u003E\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ERiscos e benefícios para estar neste estudo:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Nenhuma informação de identificação será coletada de você e, portanto, suas respostas serão anônimas. O estudo atual é semelhante a um jogo online, o que pode causar algum cansaço ou tédio com base na tarefa que você deve concluir.\n    \u003Cbr \u002F\u003E\n   Não há nenhum benefício direto para você por participar deste estudo. No entanto, suas respostas contribuirão para nossa compreensão da linguagem e dos processos de memória cognitiva. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ECompensação:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003ENão estão previstas compensações por sua participação nesta pesquisa. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EConfidencialidade e compartilhamento de dados:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n  Serão tomadas medidas para garantir que todas as informações fornecidas por você sejam anônimas. Os dados deste projeto serão disponibilizados publicamente para uso de outros pesquisadores; no entanto, nenhum dado será vinculado diretamente a você. Seu nome ou outras informações de identificação não serão inseridos no conjunto de dados e nenhuma referência será feita em relatórios verbais ou escritos que possam vinculá-lo ao estudo. Em qualquer publicação, as informações serão fornecidas de forma que você não possa ser identificado.\n    \u003Cbr \u002F\u003E\n   Antes que seus dados sejam compartilhados fora da equipe de pesquisa, qualquer informação potencialmente identificável será removida. Os dados anônimos podem ser usados pela equipe de pesquisa ou compartilhados com outros pesquisadores, para fins de pesquisa relacionados e não relacionados no futuro. Seus dados anônimos também podem ser disponibilizados em repositórios de dados online como o Open Science Framework (que são repositórios de dados gratuitos que exigem registro para ter acesso), que permitem que outros pesquisadores e interessados acessem os dados para posterior análise.\n    \u003Cbr \u002F\u003E\n    Observe que seus dados serão anônimos, o que significa que você não pode solicitar que sejam removidos depois de concluir o estudo.\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003ENatureza Voluntária do Estudo:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    A participação neste estudo é voluntária:\nSua decisão de participar não afetará suas relações atuais ou futuras com a Universidade de Ciência e Tecnologia de Harrisburg ou sua instituição local. Se você decidir participar, você é livre para não responder a nenhuma pergunta ou desistir a qualquer momento sem afetar esses relacionamentos.\n\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EContatos e Dúvidas:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    O responsável pela condução deste estudo no Brasil é o pesquisador Dr. Paulo Roberto dos Santos Ferreira, com aprovação no CEP local. Você pode fazer qualquer pergunta que tiver agora. Se você tiver dúvidas após a realização do estudo, entre em contato com o Dr. Paulo Roberto dos Santos Ferreira em pauloferreira@ufgd.edu.br.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003E\u003Cb\u003EPerguntas ou preocupações:\u003C\u002Fb\u003E\n    \u003Cbr \u002F\u003E\n    Este estudo foi revisado pelo Conselho Ética em Pesquisa (CEP) da Universidade Federal da Grande Dourados. O CEP determinou que este estudo cumpre as obrigações de proteção de sujeitos de pesquisa com seres humanos exigidas pelas leis estaduais e federais e pelas políticas da Universidade. \n\n    \u003Cp class=\"text-left\"\u003E\u003Ca href=\"https:\u002F\u002Fosf.io\u002F6m7gj\u002Fdownload\"\u003E Uma cópia dessas informações para manter em seus registros será fornecida mediante solicitação.\u003C\u002Fa\u003E\u003C\u002Fp\u003E\n\n    \u003C\u002Fdiv\u003E\n    \n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n  Por favor, pressione \u003Ckbd\u003EEspaço\u003C\u002Fkbd\u003E para concordar em participar do estudo e continuar.\n\u003C\u002Ffooter\u003E"
